def factorize(y):
    z = []
    x = 3
    while x * x <= y:
        if y % x == 0:
            z.append(x)
            while y % x == 0:
                y //= x
        x += 1
    if y > 1:
        z.append(y)
    return z

def CoprimeCount(fact, x):
    k = len(fact)
    Net = 1 << k
    ans = 0
    for mask in range(Net):
        cnt = 0
        val = 1
        for i in range(k):
            if 1 << i & mask != 0:
                val *= fact[i]
                cnt += 1
        if cnt & 1 == 1:
            ans -= x // val
        else:
            ans += x // val
    return ans

def count_destroyed_guns(y, x1, x2):
    y = abs(y)
    if y == 1:
        if x1 * x2 <= 0:
            return abs(x1) + abs(x2) + 1
        else:
            return abs(x2 - x1) + 1
    if y == 0:
        if x1 < 0 and x2 > 0:
            return 3
        elif x1 == 0 and x2 > 0 or (x1 < 0 and x2 == 0):
            return 2
        else:
            return 1
    fact = factorize(y)
    ans = 0
    if x1 * x2 < 0:
        ans += CoprimeCount(fact, abs(x1))
        ans += CoprimeCount(fact, abs(x2))
    else:
        if x1 <= 0 and x2 <= 0:
            (x1, x2) = (-x2, -x1)
        ans += CoprimeCount(fact, x2)
        ans -= CoprimeCount(fact, max(0, x1 - 1))
    return ans

